(1, 'DJI Air 2S', '999.000', 'data:image/jpeg;base64,', 'data:image/webp;base64,', 'data:image/jpeg;base64,', 'Con un sensor CMOS de 1 pulgada, potentes funciones autónomas y un cuerpo compacto que pesa menos de 600 g, el DJI Air 2S es el dron perfecto para fotógrafos aéreos que no dejan de viajar. Gracias a la potencia del todo en uno, podrá grabar con un alucinante nivel de detalle las aventuras en que se embarque en cualquier lugar y circunstancia. In the Box 1 Aeronave ×1 2 Control remoto DJI RC-N1 ×1 3 Batería de Vuelo Inteligente ×1 4 Cargador de batería ×1 5 Cable de alimentación AC ×1 6 Hélices de reducción de ruido (par) ×3 7 Protector del estabilizador ×1 8 Cable tipo C ×1 9 Cable DJI RC-N1 RC (conector USB tipo C) ×1 10 Cable DJI RC-N1 RC (conector Lightning) ×1 11 Cable DJI RC-N1 RC (conector micro-USB estándar) ×1 12 Palancas de control DJI RC-N1 de repuesto (par) ×1 - 1. El Fly More Combo incluye filtros ND de pasos bajos (ND 4/8/16/32). Los filtros ND de pasos altos (ND 64/128/256/512) se venden por separado. 2. FocusTrack no está disponible al grabar en 5.4K/30 fps, 5.4K/25 fps, 5.4K/24 fps, 4K/60 fps, 4K/50 fps, 4K/48 fps, 2.7K/60 fps, 2.7K/50 fps, 2.7K/48 fps, 1080p/120 fps, 1080p/60 fps, 1080p/50 fps o 1080p/48 fps. FocusTrack no se puede usar al grabar vídeos de 5.4K. 3. APAS 4.0 no está disponible al grabar en 5.4K/30 fps, 5.4K/25 fps, 5.4K/24 fps, 4K/60 fps, 4K/50 fps, 4K/48 fps, 2.7K/60 fps, 2.7K/50 fps, 2.7K/48 fps o 1080p/120 fps. Compatibilidad: 【Compatibilidad】La aplicación DJI Fly requiere iOS 11.0, Android 6.0 o superior. Es compatible con: iPhone 11 Pro Max, iPhone 11 Pro, iPhone 11, iPhone XS Max, iPhone XS, iPhone XR, iPhone X, iPhone 8 Plus, iPhone 8, iPhone 7 Plus, iPhone 7, iPhone 6s Plus, iPhone 6s, iPhone 6 Plus, iPhone 6, iPad Pro (9.7-inch), iPad air2 (9.7-inch), iPad mini4 (8-inch), iPad Pro (10.5-inch), iPad Pro 2018 (11-inch), iPad Pro (12.9-inch), Compatible with Samsung Galaxy S20, Samsung Galaxy S10+, Samsung Galaxy S10, Samsung Galaxy S9+, Samsung Galaxy S9 , Samsung Galaxy S8+, Samsung Galaxy S8, Samsung Galaxy S7 edge, Samsung Galaxy S7, Samsung Galaxy S6, Samsung Galaxy Note10+ , Samsung Galaxy Note9, Samsung Galaxy Note8, HUAWEI Mate30 Pro, HUAWEI P30 Pro, HUAWEI P30, HUAWEI P20, HUAWEI P10, HUAWEI Mate 20 Pro, HUAWEI Mate 10, HUAWEI nova 5, HUAWEI nova 4, HUAWEI nova 3e, HUAWEI nova 2, Honor 8X, Honor V10, Honor 9, Honor 20 Pro, Honor Magic 2, MI10, Mi 8, Mi MIX 2S, Mi MIX 2, Redmi Note 5, OPPO Find X, OPPO R15, vivo NEX, vivo X27, vivo X21, vivo X20A, OnePlus 7, OnePlus 6T, OnePlus 5, Pixel 4, Pixel 3 XL, Pixel 2 XL, Pixel 2, Pixel, LG V20, LG G6, Sony Xperia 1');
INSERT INTO `articulo` (`id`, `nombre`, `precio`, `img1`, `img2`, `img3`, `descripcion`) VALUES
(2, 'DJI Mini 2', '459.000', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'PACK LIGERO, VOLAR LIBRE: Con menos de 249 g, pesa tanto como una manzana y cabe en la palma de la mano; compacto y conveniente, Mini 2 es tu compañero de viaje adecuado, transformando la forma de capturar tus recuerdos favoritos 3 EJES GIMBAL CON UNA CÁMARA DE 4K: Una cámara de 12 MP en el cielo ofrece un contenido garantizado para impresionar; junto con el vídeo de 4K/30fps y un cardán motorizado de 3 ejes, Mini 2 asegura una calidad de imagen impresionante que es constantemente fluida sin importar lo aventurero que sea su pilotaje OCUSYNC 2.0 TRANSMISIÓN DE VIDEO: Mini 2 soporta hasta 10 km de transmisión de vídeo HD y tiene óptimas capacidades anti-interferencias, lo que le permite volar más lejos y ver más nítidamente POTENTE RENDIMIENTO: Con una duración máxima de la batería de 31 minutos, DJI Mini 2 concede tiempo más que suficiente para componer la toma adecuada; Mini 2 puede resistir vientos de nivel 5 y despegar a una altitud máxima de 4.000 metros, por lo que su material es estable incluso cuando vuela a lo largo de una costa ventosa o por encima de un bosque alpino 4X ZOOM: No hay necesidad de acercarse tanto para la toma de tu sueño; el zoom digital 4x hace que sea más seguro y conveniente cuando se hace la transición entre tomas de diferente distancia y composición QUICKSHOTS: Con sólo unos pocos toques, DJI Mini 2 graba y filma automáticamente vídeos de nivel profesional para compartirlos directamente en las redes sociales; tanto si eres un principiante como si eres un piloto más experimentado, la aplicación DJI Fly te ayuda a producir resultados impresionantes con bandas sonoras y filtros');
INSERT INTO `articulo` (`id`, `nombre`, `precio`, `img1`, `img2`, `img3`, `descripcion`) VALUES
(3, 'Mavic Air 2', '849.000', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'Características: DJI Mavic Mini, portátil y compacto, pesa 249 gr, por ello está incluido en la clase de peso más baja y más segura de los drones, ofrece 30 minutos de vuelo con una carga completa Gimbal: DJI Mavic Mini admite fotos aéreas de 12MP y vídeo Quad HD de 2.7K, el gimbal motorizado de 3 ejes proporciona una estabilidad superior de la cámara y ofrece disparos más fluidos Control remoto: el controlador de vuelo mantiene una conexión de video de alta definición hasta a 2 km di distancia, los mandos extraíbles pueden guardarse dentro del controlador Fly APP: La aplicación DJI Fly permite crear películas con pocos taps, también dispone del Flight Tutorial, una función que facilita el uso de Mavic Mini de forma intuitiva Contenido: protector cámara, 3 x batería de vuelo inteligente, control remoto, 3 x hélices repuesto, 2 x Cable Micro USB, Cable control remoto (conector Micro USB, USB-C, Lightning), Stick repuesto Sistema operativo requerido iOS 10.0 o posterior, Android 5.0 o posterior');
INSERT INTO `articulo` (`id`, `nombre`, `precio`, `img1`, `img2`, `img3`, `descripcion`) VALUES
(4, 'Mavic Mini', '399.000', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'DETALLES EXTREMADAMENTE ALTA RESOLUCIÓN Tome impresionantes fotos de 48 megapíxeles con un sensor CMOS de 1/2 \", mientras puede crear videos 4K / 60fps particularmente perfectos con el cardán de 3 ejes Mavic Air 2 es compatible con Hyperlapse en 8K, por lo que puede distorsionar fácilmente el tiempo y el espacio para obtener imágenes particularmente fascinantes. MÁS TIEMPO EN EL AIRE La enorme duración de la batería de hasta 34 minutos le permite tomar grabaciones épicas, mientras que los sensores en la parte delantera, trasera e inferior detectan obstáculos y evitan accidentes. VUELA MÁS ALLÁ La transmisión de video OcuSync 2.0 puede transmitir la imagen de la cámara a una distancia de hasta 10 km, con una resolución de hasta 1080p a 30 fps VUELO INTELIGENTE Con ​​Spotlight 2.0, la cámara fija un sujeto en vuelo, ActiveTrack 3.0 mantiene el encuadre del sujeto centrado y POI 3.0 puede rastrear dinámicamente objetos como personas PAQUETE Avión Mavic Air 2, control remoto, 3 baterías de vuelo inteligentes, 6 hélices de bajo ruido (par), cable RC (USB-C, Lightning, Micro-USB-C estándar), joystick, protección cardán, cargador de batería, cargador de batería , batería en el adaptador del banco de energía, bolso de hombro, juego de filtros ND (16/64/256), documentación, cable de alimentación de CA, cable USB-C De los 3 cables que se muestran en las imágenes, uno está ubicado en el controlador');

